function addBars(BAR_COUNT, CIRCLE_MX, CIRCLE_MY) {

    var RADIUS = 300;

    var rectangleTemplate = $part("Rectangle", "PartsBin/Basic");
    rectangleTemplate.setExtent(pt(6, 50));

    for (var i = 0; i < BAR_COUNT; i++){

        var rectangle = rectangleTemplate.basicCopy();
        rectangle.index = i;
        rectangle.setName("Bar" + i);
        var x = CIRCLE_MX + RADIUS * Math.cos(2 * Math.PI / BAR_COUNT * i);
        var y = CIRCLE_MY + RADIUS * Math.sin(2 * Math.PI / BAR_COUNT * i);
        rectangle.setPosition(pt(x, y));
        rectangle.setRotation(i * 2 * Math.PI / BAR_COUNT + 0.5 * Math.PI);
        rectangle.setOrigin(pt(3, 50));
        this.addHoverHandlerBars(rectangle,pt(x,y));
        this.get("ChartContainer").addMorph(rectangle);
    }
}

