function createChart() {

    var CIRCLE_MX = 350, CIRCLE_MY = 350, BAR_COUNT = 169;

    this.addBars(BAR_COUNT, CIRCLE_MX, CIRCLE_MY);

    this.addSquares(BAR_COUNT, CIRCLE_MX, CIRCLE_MY);

}

