function addSquares(BAR_COUNT, CIRCLE_MX, CIRCLE_MY) {

    var RECT_WIDTH = 20, RECT_HEIGHT = 20, RECT_DISTANCE = 25;
    var RECTS_PER_AXIS = Math.sqrt(BAR_COUNT);
    var WIDTH = RECTS_PER_AXIS * RECT_DISTANCE - (RECT_DISTANCE - RECT_WIDTH)
    var HEIGHT = RECTS_PER_AXIS * RECT_DISTANCE - (RECT_DISTANCE - RECT_HEIGHT)
    var RECT_START_X = CIRCLE_MX - WIDTH / 2;
    var RECT_START_Y = CIRCLE_MY - HEIGHT / 2;

    var randomColor = '#'+Math.floor(Math.random() * 16777215).toString(16);

    var rectangleTemplate = $part("Rectangle", "PartsBin/Basic");
    rectangleTemplate.setExtent(pt(RECT_WIDTH, RECT_HEIGHT));
    rectangleTemplate.setFill(Color.rgbHex(randomColor));

    for (var i = 0; i < BAR_COUNT; i++){

        var rectangle = rectangleTemplate.basicCopy();
        rectangle.index = i;
        rectangle.setName("Square" + i);
        var x = RECT_START_X + (i % RECTS_PER_AXIS) * RECT_DISTANCE;
        var y = RECT_START_Y + (Math.floor(i / RECTS_PER_AXIS)) * RECT_DISTANCE;
        rectangle.setPosition(pt(x, y));
        rectangle.setOrigin(pt(RECT_WIDTH / 2, RECT_HEIGHT / 2));

        this.get("ChartContainer").addMorph(rectangle);

        this.addHoverHandler(rectangle, pt(x, y));

    }
}

8509.source:
function addHoverHandler(rectangle, position) {

    rectangle.onMouseMoveEntry = function(x, y) {
        return function (evt) {
            this.setScale(1.2);
            this.get("Bar" + rectangle.index).setScale(1.5);
        }
    }(position.x, position.y);

    rectangle.onMouseOut = function(x, y) {
        return function (evt) {
            this.setScale(1);
            this.get("Bar" + rectangle.index).setScale(1);
        }
    }(position.x, position.y);

}

